import Form from "./Form";

function PopupWithForm({
    name,
    title,
    value,
    isOpen,
    onClose,
    handleSubmit,
    children,
}) {
    return (
        <section
            className={`popup section__popup popup_type_${name} ${
                isOpen ? "popup_opened" : ""
            }`}
        >
            <div className="popup__container">
                <Form
                    name={name}
                    title={title}
                    value={value}
                    onClose={onClose}
                    handleSubmit={handleSubmit}
                    children={children}
                />
            </div>
        </section>
    );
}

export default PopupWithForm;
